  }

  render() {
    const date = new Date();
    return (
      <header>
        <div className="header-team">#ЕдинаяКоманда</div>
        <div id="header-date" className="header-date">
        <Moment>{date}</Moment>
        </div>
      </header>
    )
  }
}

export default RegistrationHeader;
